const areTripletsBeautiful = (i, j, k, d) =>
	i < j && j < k && k - j === d && d === j - i

const beautifulTriplets = (d, arr) => {
	let combinations = []
	for (let i = 0; i + 2 < arr.length; i++)
		for (
			let j = i + 1;
			j + 1 < arr.length && arr[j] - arr[i] <= d;
			j++
		)
			for (
				let k = j + 1;
				k < arr.length && arr[k] - arr[j] <= d;
				k++
			)
				if (areTripletsBeautiful(arr[i], arr[j], arr[k], d))
					combinations = [...combinations, [i, j, k]]

	return combinations.length
}

